import React, { Component } from 'react';
import './beranda.css';
import Banner from './img/banner.png';
import ticketsoad from './img/ticketsoad.jpeg'

class Beranda extends Component {
    render() {
        return (
            <div className="container">
                {/* Banner Image */}
                <a href='./beranda'><img
                    src={Banner}
                    className="banner-img" /></a>

                {/* Trending Background */}
                <div className="trending-bg">
                    <div className='trending'>
                        <h1>1</h1>
                    </div> 
                </div>

                {/* Kontainer Jual Beli */}
                <div className="ticket-container">
                    <div className="item">
                        <a href=''><img src={ticketsoad} alt="Item 1" />
                        <p>System Of A Down</p></a>
                    </div>
                    <div className="item">
                        <img src="gambar2.png" alt="Item 2" />
                        <p>Deskripsi Item 2</p>
                    </div>
                    <div className="item">
                        <img src="gambar3.png" alt="Item 3" />
                        <p>Deskripsi Item 3</p>
                    </div>
                    <div className="item">
                        <img src="gambar4.png" alt="Item 4" />
                        <p>Deskripsi Item 4</p>
                    </div>
                </div>
            </div>
        );
    }
}

export default Beranda;
